import React, {useState, useEffect} from 'react';

import './ClientsStyle.css';
import '../../core/CoreStyle.css';
import { C_ButtonIcon, C_Modal, C_TextField} from '../../core/Components/Components';

export function Clients(props) {

    const [showModalClient, setShowModalClient] = useState(false);

    function showModal(){
        setShowModalClient(true);
    }

    return (
        <div className="page">
            <span className="div fade-in">
                <h1>Clientes</h1>
                <C_ButtonIcon onClick={showModal} icon="person_add" label="Cadastrar"/>
            </span>
            <C_Modal onClose={() => setShowModalClient(false)} tittle={"Novo Cliente"} show={showModalClient}>
                <fieldset style={{ width: "100%", margin: "auto", border: "1px solid silver", borderRadius: 5, marginBottom: 40, paddingTop: 8 }}>
                    <legend style={{ width: "auto", border: "none", paddingRight: 5, paddingLeft: 5, marginLeft: 10, marginBottom: 0, fontWeight: "bold", fontSize: 15, color: "#757575" }}>Prop</legend>
                    <div style={{marginBottom:20}}>
                        <C_TextField outoFocus={true} style={{width: "100%"}} label="Nome" icon="person" placeholder=""/>
                    </div>
                    <div style={{ width: "100%", display: "flex", alignItems: "center", marginBottom:20}}>
                        <div style={{ width: "39%", marginRight: "2%"}}>
                            <C_TextField style={{ width: "100%" }} label="Celular" icon="phone_iphone" placeholder="" />
                        </div>
                        <div style={{ width: "59%"}}>
                            <C_TextField style={{width:"100%"}} label="Email" icon="email" placeholder=""/>
                        </div>
                    </div>
                </fieldset>
                <fieldset style={{ width: "100%", margin: "auto", border: "1px solid silver",borderRadius:5, marginBottom: 40, paddingTop: 8 }}>
                    <legend style={{ width: "auto", border: "none", paddingRight: 5, paddingLeft: 5, marginLeft: 10, marginBottom: 0, fontWeight: "bold", fontSize: 15, color: "#757575" }}>veiculo</legend>



                </fieldset>
            </C_Modal>
        </div>
    );
}
